/**
 * Process the manifest and prepare procedures for ingestion
 */
function prepareProceduresFromManifest(): Map<string, {
  id: string;
  name: string;
  keywords: string[];
  metroAreas: MetroAvailability[];
}> {
  const procedureMap = new Map<string, {
    id: string;
    name: string;
    keywords: string[];
    metroAreas: MetroAvailability[];
  }>();

  for (const metro of PROCEDURE_MANIFEST.metro_areas) {
    for (const proc of metro.procedures) {
      const existing = procedureMap.get(proc.id);

      const metroInfo: MetroAvailability = {
        slug: metro.slug,
        name: metro.name,
        filePath: proc.files.public?.path || '',
        fileUrl: proc.files.public?.url || ''
      };

      if (existing) {
        // Add metro to existing procedure
        existing.metroAreas.push(metroInfo);
      } else {
        // Create new procedure entry
        procedureMap.set(proc.id, {
          id: proc.id,
          name: proc.name,
          keywords: proc.keywords,
          metroAreas: [metroInfo]
        });
      }
    }
  }

  return procedureMap;
}

