    console.log('Step 2: Preparing procedures from manifest...');
    const procedureMap = prepareProceduresFromManifest();
    const procedures = Array.from(procedureMap.values());
    console.log(`Prepared ${procedures.length} unique procedures.\n`);

    // Step 3: Bulk upsert with embeddings
